    useEffect(() => {
        M.AutoInit();
    }, []);


  return (
    <div>
      <a
        className='btn modal-trigger'
        data-target={id}
      >
        {props.day}
      </a>
      <div id={id} className='modal'>
          lista zeby moc dodawac eventy
<AddEditTask />
      </div>
    </div>
  );
};

export default AddEditIngredient;
